export default function Home() {
  return (
    <div className="center below-header home-container">
      <h1>App & Browser Testing Made Easy !</h1>
      <p>
        Give your users a seamless experience by testing on 3000+ real devices
        and browsers. Don't compromise with emulators and simulators.
      </p>
      <div className="buttons-container">
        <button>Get a demo</button>
        <button>Contact us</button>
      </div>
    </div>
  );
}
